import React, {Component} from 'react';
import './Weather.css';



const Weather = (props) => {

    const {data, deleteItem} = props;

  return(

      <div>
          <div className="WeatherList-item">
              <h2>{data.name}</h2>
              <h2>{data.temp + " °C"}</h2>
          </div>
          <div>
              <input type = "Button" value = 'удалить' onClick={deleteItem} />
          </div>
      </div>


    );

};


class WeatherList extends Component {

    constructor(props) {
        super(props);

        this.state = {
          cityDates: props.data
        };
    }


    render() {

        const weatherList = this.props.data.map((data) =>

            <Weather data={data} key={data.id} deleteCity = {() => this.props.deleteItem(data.id)} />

        );


        return (

            <div className = "WeatherList">{weatherList}</div>

        );
    }

}


export default WeatherList;
